def analyze_python_file(file_path: str) -> Dict[str, Any]:
    """Analyze a Python file for functions, classes, and potential issues"""
    try:
        with open(file_path, 'r', encoding='utf-8') as f:
            content = f.read()

        tree = ast.parse(content)

        functions = []
        classes = []
        imports = []
        hardcodes = []
        problems = []

        for node in ast.walk(tree):
            if isinstance(node, ast.FunctionDef):
                functions.append({
                    'name': node.name,
                    'line': node.lineno,
                    'args': [arg.arg for arg in node.args.args],
                    'docstring': ast.get_docstring(node),
                    'is_async': isinstance(node, ast.AsyncFunctionDef)
                })

                # Check for long functions
                if hasattr(node, 'end_lineno') and node.end_lineno:
                    func_length = node.end_lineno - node.lineno
                    if func_length > 50:
                        problems.append({
                            'type': 'long_function',
                            'severity': 'medium',
                            'line': node.lineno,
                            'description': f"Function '{node.name}' is {func_length} lines long",
                            'suggestion': 'Consider breaking into smaller functions'
                        })

            elif isinstance(node, ast.ClassDef):
                classes.append({
                    'name': node.name,
                    'line': node.lineno,
                    'methods': [n.name for n in node.body if isinstance(n, ast.FunctionDef)],
                    'docstring': ast.get_docstring(node)
                })

            elif isinstance(node, (ast.Import, ast.ImportFrom)):
                if isinstance(node, ast.Import):
                    imports.extend([alias.name for alias in node.names])
                else:
                    imports.append(node.module or '')

        # Check content for hardcoded values using regex (more reliable than AST for this)
        lines = content.split('\n')
        for i, line in enumerate(lines, 1):
            # Look for IP addresses
