            for ip in ip_matches:
                if ip.startswith('172.16.168.') or ip.startswith('127.0.0.') or ip.startswith('192.168.'):
                    hardcodes.append({
                        'type': 'ip',
                        'value': ip,
                        'line': i,
                        'context': line.strip()
                    })

            # Look for URLs
            url_matches = re.findall(r'[\'"`](https?://[^\'"` ]+)[\'"`]', line)
            for url in url_matches:
                hardcodes.append({
                    'type': 'url',
                    'value': url,
                    'line': i,
                    'context': line.strip()
                })

            # Look for port numbers
            port_matches = re.findall(r'\b(80[0-9][0-9]|[1-9][0-9]{3,4})\b', line)
            for port in port_matches:
                if port in ['8001', '8080', '6379', '11434', '5173', '3000']:
                    hardcodes.append({
                        'type': 'port',
                        'value': port,
                        'line': i,
                        'context': line.strip()
                    })

        return {
            'functions': functions,
            'classes': classes,
            'imports': imports,
            'hardcodes': hardcodes,
            'problems': problems,
            'line_count': len(content.splitlines())
        }

